create table project_libs
(
    id              bigint auto_increment
        primary key,
    dep_artifact_id varchar(255) not null,
    create_at       datetime(6)  not null,
    create_by       varchar(255) not null,
    dep_group_id    varchar(255) null,
    product         varchar(255) not null,
    product_line    varchar(255) null,
    dep_scope       varchar(255) null,
    dep_version     varchar(255) not null
);

